import React from 'react';
import { Card, Button } from 'react-bootstrap';

const statusColors = {
  Pending: 'text-primary',
  'In-Process': 'text-warning',
  Complete: 'text-success'
};

const IncidentCard = ({ title, status }) => {
  return (
    <Card className="m-2 shadow-sm" style={{ width: '18rem', position: 'relative' }}>
      <button
        type="button"
        className="btn-close position-absolute top-0 end-0 m-2"
        aria-label="Close"
      ></button>
      <Card.Body>
        <Card.Title>{title}</Card.Title>
        <Card.Text>
          <div>Date of submission</div>
          <div className={statusColors[status]}>{status}</div>
        </Card.Text>
        <Button variant="link" className="p-0">Edit the submission â†’</Button>
      </Card.Body>
    </Card>
  );
};

export default HarassmentReport;
